import React from 'react';
import { Link } from 'react-router-dom';

const teams = [
  { id: 'dragoes-do-norte', name: 'Dragões do Norte' },
  { id: 'leoes-da-serra', name: 'Leões da Serra' },
  { id: 'aguias-do-sul', name: 'Águias do Sul' },
  { id: 'guerreiros-do-oeste', name: 'Guerreiros do Oeste' },
  { id: 'estrelas-do-leste', name: 'Estrelas do Leste' },
  { id: 'falcoes-de-prata', name: 'Falcões de Prata' },
  { id: 'lobos-do-cerrado', name: 'Lobos do Cerrado' },
  { id: 'trovoes-do-vale', name: 'Trovões do Vale' },
  { id: 'panteras-negras', name: 'Panteras Negras' },
  // Adicione os outros times aqui
];

const TeamList = () => {
  return (
    <div className="team-list">
      <h2>Times</h2>
      <ul>
        {teams.map((team) => (
          <li key={team.id}>
            <Link to={`/team/${team.id}`}>{team.name}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default TeamList;
